import { Link, Paper, Typography } from "@mui/material";
import React from "react";
import Usefetch from "../pages/UseFetch";
function EmployeeDetail({ id, showprofie }) {
  const { data, loading, error } = Usefetch(
    `https://retoolapi.dev/H2F0Ui/getemployedetail?id=${id}`
  );
  console.log("data", data);
  function openWindow(url) {
    window.open(url);
  }
  return (
    <div>
      <h1>vanakam da mapla </h1>
      <Paper
        style={{
          border: "1px solid #159580",
          borderRadius: 10,
          width: 380,
          padding: 10,
          display: "flex",
          flexDirection: "column",
        }}
      >
        <div style={{ display: "flex", gap: 5, flex: 2 }}>
          <div
            style={{
              flexBasis: "30%",
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              flexDirection: "column",
            }}
          >
            {" "}

            {data?.map((val, idx) => (
              <>
               <img src={val?.company_logo} style={{ height: 60, width: 60 }} />
                <Typography>{val?.name}</Typography>
                <Typography>{val?.rating}</Typography>
                <Typography>{val?.company}</Typography>
                <Typography>{val?.interests}</Typography>
                <a
                  href={val?.view_more}
                  onclick="window.open('print.html', 
                         'newwindow', 
                         'width=150,height=150'); 
              return false;"
                >
                  view_more
                </a>
                <Typography>{val?.job_description}</Typography>

              </>
            ))}
          </div>
        </div>
      </Paper>
    </div>
  );
}

export default EmployeeDetail;
